INSERT INTO `products` VALUES (6,'Bộ Bàn Ăn Scania (Màu Tự Nhiên, Mặt Vân Đá, 140)',100,13990000,11990000,'<p><span style=\"font-family: \'times new roman\', times, serif;\"><strong>BỘ&nbsp;B&Agrave;N ĂN V&Acirc;N Đ&Aacute; TỰ NHI&Ecirc;N&nbsp;<u>SCANIA</u></strong></span></p>\r\n<h2><span style=\"font-family: \'times new roman\', times, serif;\"><strong>1. TH&Ocirc;NG SỐ KỸ THUẬT</strong></span></h2>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"Nội dung sản phẩm\" src=\"https://file.hstatic.net/200000065946/file/z6597452262947_58a5437d38425367e5b0c8e62af26737_57c61a20a44b4815bf4ac9abd4b97737_2048x2048.jpg\" alt=\"bộ b&agrave;n ăn scania\" width=\"252\" height=\"252\"></span></p>\r\n<p>&nbsp;</p>\r\n<h2><span style=\"font-family: \'times new roman\', times, serif;\"><strong>2. CHI TIẾT VẬT LIỆU</strong></span></h2>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\"><strong>Khung ch&acirc;n : Gỗ cao su tự nhi&ecirc;n</strong></span></p>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\">B&agrave;n ăn gia đ&igrave;nh l&agrave;m từ chất liệu&nbsp;<a href=\"https://moho.com.vn/blogs/noi-that-ung-dung/tim-hieu-ve-cac-loai-go-tu-nhien-thong-dung\" target=\"_blank\" rel=\"noopener\"><u><strong>gỗ cao su</strong></u></a>&nbsp;tự nhi&ecirc;n đảm bảo độ chắc chắn cao, chống c&ocirc;ng v&ecirc;nh, mối mọt. M&agrave;u gỗ bắt mắt, đẹp tạo n&eacute;t hiện đại&nbsp;.</span></p>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\"><strong>Mặt b&agrave;n : Gỗ c&ocirc;ng nghiệp phủ Melamine v&acirc;n đ&aacute; tự nhi&ecirc;n&nbsp;</strong></span></p>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\">Lớp phủ Melamine c&oacute; thể t&aacute;i tạo ch&acirc;n thật v&acirc;n đ&aacute; tự nhi&ecirc;n mang lại vẻ đẹp sang trọng v&agrave; hiện đại.</span></p>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"Nội dung sản phẩm\" src=\"https://file.hstatic.net/200000065946/file/z6526735263438_ce3f3e4fb92840a04b2488b8a5ceffe2_1024x1024.jpg\" width=\"372\" height=\"186\"></span></p>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\"><em>* Một số sản phẩm sử dụng gỗ tự nhi&ecirc;n c&oacute; thể xuất hiện mắt gỗ ngẫu nhi&ecirc;n v&agrave; v&acirc;n gỗ tr&ecirc;n bề mặt mỗi sản phẩm sẽ kh&aacute;c nhau &ndash; điều n&agrave;y l&agrave; ho&agrave;n to&agrave;n tự nhi&ecirc;n, tạo n&ecirc;n sự độc đ&aacute;o ri&ecirc;ng cho từng sản phẩm. V&igrave; vậy MOHO sẽ kh&ocirc;ng &aacute;p dụng c&aacute;c ch&iacute;nh s&aacute;ch đổi trả, bảo h&agrave;nh v&agrave; bảo tr&igrave; cho c&aacute;c trường hợp n&agrave;y.</em></span></p>\r\n<p>&nbsp;</p>\r\n<h2><span style=\"font-family: \'times new roman\', times, serif;\"><strong>3.&nbsp;ĐẶC ĐIỂM NỔI BẬT</strong></span></h2>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\">Mang phong c&aacute;ch hiện đại v&agrave; tinh tế, B&agrave;n Ăn SCANIA v&acirc;n đ&aacute; l&agrave; lựa chọn ho&agrave;n hảo cho kh&ocirc;ng gian ph&ograve;ng ăn sang trọng. Sự kết hợp giữa mặt b&agrave;n v&acirc;n giả đ&aacute; cao cấp v&agrave; khung ch&acirc;n từ gỗ cao su tự nhi&ecirc;n vững chắc kh&ocirc;ng chỉ mang đến vẻ đẹp thẩm mỹ m&agrave; c&ograve;n đảm bảo độ bền vượt trội theo thời gian.&nbsp;</span></p>\r\n<h3><span style=\"font-family: \'times new roman\', times, serif;\"><strong>Mặt b&agrave;n gỗ c&ocirc;ng nghiệp phủ Melamine v&acirc;n đ&aacute; tự nhi&ecirc;n</strong></span></h3>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\">Tạo cảm gi&aacute;c sang trọng, hiện đại như đ&aacute; thật m&agrave; nhẹ&nbsp;hơn rất nhiều.&nbsp;</span></p>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"Nội dung sản phẩm\" src=\"https://file.hstatic.net/200000065946/file/dsc04419_1024x1024.jpg\" width=\"243\" height=\"243\"></span></p>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\"><strong>Gi&aacute; th&agrave;nh hợp l&yacute; :&nbsp;</strong>So với mặt đ&aacute; tự nhi&ecirc;n, mặt b&agrave;n phủ Melamine v&acirc;n đ&aacute; c&oacute; chi ph&iacute; thấp hơn nhiều nhưng vẫn giữ được n&eacute;t đẹp tinh tế</span></p>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"Nội dung sản phẩm\" src=\"https://file.hstatic.net/200000065946/file/dsc04395_1024x1024.jpg\" width=\"243\" height=\"243\"></span></p>\r\n<h3><span style=\"font-family: \'times new roman\', times, serif;\"><strong>Cạnh b&agrave;n được thiết kế bo tr&ograve;n</strong></span></h3>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\">Thiết kế b&agrave;n ăn hiện đại tối ưu sự an to&agrave;n của người d&ugrave;ng được thể hiện qua c&aacute;c g&oacute;c cạnh được bo tr&ograve;n, hạn chế tổn thương nếu xảy ra va đập, nhất l&agrave; đối với những gia đ&igrave;nh c&oacute; trẻ nhỏ hiếu động.&nbsp;</span></p>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"Nội dung sản phẩm\" src=\"https://file.hstatic.net/200000065946/file/dsc04389_a5d5e670fcff43398779a312b59c0398_1024x1024.jpg\" width=\"300\" height=\"300\"></span></p>\r\n<p>&nbsp;</p>\r\n<h3>&nbsp;</h3>\r\n<h3><span style=\"font-family: \'times new roman\', times, serif;\"><strong>Chiều cao bộ&nbsp;b&agrave;n thể hiện&nbsp;được th&oacute;i quen sử dụng của người Việt</strong></span></h3>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\">Chiều cao bộ&nbsp;b&agrave;n ăn SCANIA&nbsp;đạt chuẩn 75cm ph&ugrave; hợp cho gia đ&igrave;nh bạn. K&iacute;ch thước b&agrave;n&nbsp;ăn n&agrave;y rất dễ d&agrave;ng bắt gặp tại c&aacute;i ng&ocirc;i nh&agrave; hay qu&aacute;n ăn&nbsp;tại Việt Nam, v&igrave; n&oacute; mang lại sự gần gũi v&agrave; thuận tiện khi d&ugrave;ng bữa v&agrave; l&agrave;m việc.</span></p>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"Nội dung sản phẩm\" src=\"https://file.hstatic.net/200000065946/file/dsc04416_1024x1024.jpg\" width=\"298\" height=\"298\"></span></p>\r\n<p>&nbsp;</p>\r\n<h3><span style=\"font-family: \'times new roman\', times, serif;\"><strong>Mặt b&agrave;n hạn chế&nbsp;thấm nước</strong></span></h3>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\">Mặt b&agrave;n ăn cơm hạn chế&nbsp;thấm nước&nbsp;gi&uacute;p cho việc lau ch&ugrave;i trở n&ecirc;n đơn giản v&agrave; dễ d&agrave;ng hơn mỗi khi d&ugrave;ng bữa.</span></p>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"Nội dung sản phẩm\" src=\"https://file.hstatic.net/200000065946/file/dsc04395_3354fa2cbaf34ef3918e5eee61e621d9_1024x1024.jpg\" width=\"307\" height=\"307\"></span></p>\r\n<h3>&nbsp;</h3>\r\n<h3><span style=\"font-family: \'times new roman\', times, serif;\"><strong>Kết cấu khung ch&acirc;n chắc chắn</strong></span></h3>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\">Ch&acirc;n b&agrave;n&nbsp;chế t&aacute;c từ gỗ cao su tự nhi&ecirc;n, đảm bảo kết cấu chắc chắn, vững ch&atilde;i&nbsp;v&agrave; khả năng chịu lực tốt,&nbsp;c&ugrave;ng logo MOHO độc quyền tr&aacute;nh h&agrave;ng giả.&nbsp;</span></p>\r\n<p><span style=\"font-family: \'times new roman\', times, serif;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"Nội dung sản phẩm\" src=\"https://file.hstatic.net/200000065946/file/dsc04380_1024x1024.jpg\" width=\"276\" height=\"276\"></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h2><span style=\"font-family: